import React,{Component} from 'react';
import { library } from '@fortawesome/fontawesome-svg-core'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faBars,faSearch,faChevronLeft } from '@fortawesome/free-solid-svg-icons'
import '../../../style/detail'

library.add(faBars,faSearch,faChevronLeft)

class DetailHeader extends Component {
    render() {
        return (
            <div className="detailHeader">
                <div className="leftIcon">
                    <div className="iconLeft"> <FontAwesomeIcon icon="chevron-left" /></div>
                    <div className="iconNav"> <FontAwesomeIcon icon="bars" /></div>
                </div>
                <div className="headerTitle"><h3>项目介绍</h3></div>
                <div className="iconSearch"><FontAwesomeIcon icon="search" /></div>
            </div>
        );

    }
  }



export default DetailHeader
